import React from "react";

import Navbar from "../components/Navbar";
import ContactForm from '../components/ContactForm.js';
import Footer from "../components/Footer";

const Contact = () => {
    return <div>
        <Navbar />
        <ContactForm />
        <Footer />
    </div>;
}

export default Contact;
